import styles from "./Sidebar.module.css"; // ⬅️ без ../../
import settingsIcon from "../../Images/settings.png";
import { useNavigate } from "react-router-dom";

export default function Settings() {
  const navigate = useNavigate();

  return (
    <div className={styles.settings} onClick={() => navigate("/settings")}>
      <img src={settingsIcon} alt="Settings" className={styles.settingsImage} />
      <button className={styles.settingsButton}>Settings</button>
    </div>
  );
}
